import React, { Component } from "react";
import propTypes from "prop-types";

import "../styles/App.css";
import "../styles/bootstrap.min.css";

const DetailHome = props => {
  return (
    <div className="col-md-4 col-sm-12 offset-md-0">
      <div className="card" style={{ width: "300px" }}>
        <a href="detail.html">
          <img
            className="card-img-top"
            src={props.poster}
            alt="Card image"
            style={{ width: "100%" }}
          />
        </a>

        <div className="card-body">
          <h4 className="card-title">Agriculture Drone</h4>
          <div className="priceShow">
            <p
              className="card-text"
              style={{ float: "left", paddingRight: "20px" }}
            >
              Rp. 2.000.000
            </p>
            <p
              className="card-text"
              style={{
                textDecoration: "line-through",
                color: "red",
                display: "block"
              }}
            >
              Rp. 4.000.000
            </p>
          </div>
          <p className="card-text" style={{ clear: "left" }}>
            Some example text some example text.
          </p>
          <a
            href="detail.html"
            className="btn btn-primary stretched-link"
            style={{ marginLeft: "25%" }}
          >
            See Details
          </a>
        </div>
      </div>
    </div>
  );
};

export default Details;
